■商品説明<br>
サイズ：直径/ホール　約8mm/約1.5mm　約10mm/約1.5mm　約12mm/約1.5mm<br>
カラー：ミックス　※パール塗料が手に付く場合がございます。予めご了承ください。<br>
数量：【8mm】約480個　【10mm】約240個　【12mm】約180個　
<br><br>
■スタッフより一言♪<br>
上品なつや感のカラーパール。<br>可愛いパステルカラーに加え、秋カラーがプラスされた、これからのアクセサリー作りにおすすめのミックスです。<br>サイズは8mm、10mm、12mmと3サイズからお選びいただけます。<br>存在感のあるカラーパールで素敵なアクセサリーを作ってくださいね♪<br>
<br>
おすすめのカラーシュリンクパールはこちら♪<br>
<img src="https://image.rakuten.co.jp/auc-yumishop/cabinet/01198000/01230287/imgrc0062670193.jpg" width="150"><br><br>
